INSERT INTO `ec_reviews` VALUES (1,6,NULL,NULL,64,3.00,'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/4.jpg\",\"products\\/58.jpg\"]'),(2,4,NULL,NULL,39,2.00,'The code is good, in general, if you like it, can you give it 5 stars?','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/3.jpg\",\"products\\/20.jpg\",\"products\\/45-1.jpg\"]'),(3,5,NULL,NULL,33,1.00,'Solution is too robust for our purpose so we didn\'t use it at the end. But I appreciate customer support during initial configuration.','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/8-1.jpg\",\"products\\/19-2.jpg\",\"products\\/39-1.jpg\",\"products\\/45.jpg\"]'),(4,2,NULL,NULL,29,2.00,'As a developer I reviewed this script. This is really awesome ecommerce script. I have convinced when I noticed that it\'s built on fully WordPress concept.','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/8-3.jpg\",\"products\\/10.jpg\",\"products\\/24-2.jpg\",\"products\\/65-2.jpg\"]'),(5,3,NULL,NULL,15,2.00,'Amazing code, amazing support. Overall, im really confident in Botble and im happy I made the right choice! Thank you so much guys for coding this masterpiece','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/12-2.jpg\"]'),(6,7,NULL,NULL,55,5.00,'The code is good, in general, if you like it, can you give it 5 stars?','published','2024-08-10 00:02:07','2024-08-10 00:02:07','[\"products\\/17-2.jpg\",\"products\\/23-3.jpg\",\"products\\/25-1.jpg\",\"products\\/32-1.jpg\"]'),(7,7,NULL,NULL,27,3.00,'Cool template. Excellent code quality. The support responds very quickly, which is very rare on themeforest and codecanyon.net, I buy a lot of templates, and everyone will have a response from technical support for two or three days. Thanks to tech support. I recommend to buy.','published','2024-08-10 00